scene.onOverlapTile(SpriteKind.Player, myTiles.tile9, function (sprite, location) {
    levelCount += 1
    game.splash("Your Score:", convertToText(info.score()))
    if (levelCount == 2) {
        createLevel(levelCount)
    } else {
        game.over(true)
    }
})
