function destroyLevel () {
    Dave.destroy()
    for (let value4 of tiles.getTilesByType(myTiles.tile4)) {
        Blue_Gems.destroy()
    }
    for (let value5 of tiles.getTilesByType(myTiles.tile1)) {
        Yellow_Gems.destroy()
    }
    MagicKey.destroy()
}
